import React, { useState, useEffect } from "react";
import { fetchContributionData } from "../services/fetchCommits";
import { Pie } from "react-chartjs-2";
import "chart.js/auto";
import "../styles/styles.css";

const Dashboard = () => {
    const [selectedOrg, setSelectedOrg] = useState("");
    const [selectedRepo, setSelectedRepo] = useState("");
    const [selectedUser, setSelectedUser] = useState("");
    const [contributions, setContributions] = useState([]);
    const [chartData, setChartData] = useState(null);

    // Organization & Repositories Mapping
    const ORGANIZATIONS = {
        "HWAI-MarketIntel": [
            "EnrollmentTrendsUI-R4", "EnrollmentTrendsAPI-R4",
            "CompetitorAnalysisUI-R1", "CompetitorAnalysisAPI-R1"
        ],
        "HWAI-NetworkIntel": [
            "PNCOneToManyUI-R1", "PNCOneToManyAPI-R1",
            "NetworkAdequacyUI-R1", "NetworkAdequacyAPI-R1",
            "NPISearchUI-R4", "ProviderNetworkComparisonUI-R4",
            "ProviderNetworkComparisonAPI-R4", "NPISearchAPI-R4"
        ],
        "HWAI-XAI": [
            "ProductScorecardUI-R1", "BenefitSimulatorUI-R3.1",
            "BenefitSimulatorAPI-R3.1", "BenefitSimulatorAPI-R3",
            "ProductScorecardAPI-R1", "BenefitSimulatorUI-R3"
        ],
        "HWAI-CST": [
            "LobbyClientUI-R1", "LobbyMiddlewareAPI-R1",
            "LobbyAdminServerAPI-R1", "LobbyHeartbeatAutomationUI-R1",
            "HubspotIntegrationAPI-R1", "LobbyAdminPanelUI-R1",
            "LobbyServerAPI-R1"
        ]
    };

    const USERS = [
        "ArulTEG", "ArunPrem_APP", "deepesh-tech", "Mukul Kumar",
        "suneelkumar02", "dhorinaresh", "ankit_sde@hwai", "bindu-e",
        "Kritika-sharma12", "Promod Kr Verma", "satyajeet-HealthworksAI",
        "Rajeev Rawat", "vibhore-go", "vidushi-chaudhary"
    ];

    // Fetch Data on Click
    const handleFetchData = async () => {
        if (!selectedOrg || !selectedRepo || !selectedUser) {
            alert("Please select an organization, repository, and user!");
            return;
        }
        const data = await fetchContributionData(selectedOrg, selectedRepo, selectedUser);
        setContributions(data);
    };

    // Process Data for Pie Chart
    useEffect(() => {
        if (contributions.length > 0) {
            const userCommitMap = {};
            contributions.forEach(({ user, commits }) => {
                userCommitMap[user] = (userCommitMap[user] || 0) + commits;
            });

            setChartData({
                labels: Object.keys(userCommitMap),
                datasets: [
                    {
                        data: Object.values(userCommitMap),
                        backgroundColor: [
                            "#FF6384", "#36A2EB", "#FFCE56", "#4BC0C0", "#9966FF", "#FF9F40"
                        ]
                    }
                ]
            });
        }
    }, [contributions]);

    return (
        <div className="dashboard-container">
            {/* Header */}
            <div className="header">
                <div className="logo">HealthWorks AI</div>
                <div className="user-info">👤 Naresh</div>
            </div>

            {/* Filters */}
            <div className="filter-section">
                <div className="dropdown">
                    <label>Organization</label>
                    <select value={selectedOrg} onChange={(e) => setSelectedOrg(e.target.value)}>
                        <option value="">Select Organization</option>
                        {Object.keys(ORGANIZATIONS).map((org) => (
                            <option key={org} value={org}>{org}</option>
                        ))}
                    </select>
                </div>

                <div className="dropdown">
                    <label>Repository</label>
                    <select value={selectedRepo} onChange={(e) => setSelectedRepo(e.target.value)} disabled={!selectedOrg}>
                        <option value="">Select Repository</option>
                        {selectedOrg && ORGANIZATIONS[selectedOrg].map((repo) => (
                            <option key={repo} value={repo}>{repo}</option>
                        ))}
                    </select>
                </div>

                <div className="dropdown">
                    <label>User</label>
                    <select value={selectedUser} onChange={(e) => setSelectedUser(e.target.value)}>
                        <option value="">Select User</option>
                        {USERS.map((user) => (
                            <option key={user} value={user}>{user}</option>
                        ))}
                    </select>
                </div>

                <button className="execute-btn" onClick={handleFetchData}>Execute</button>
            </div>

            {/* Data Table */}
            <div className="table-container">
                <table>
                    <thead>
                        <tr>
                            <th>User</th>
                            <th>Repository</th>
                            <th>Commits</th>
                        </tr>
                    </thead>
                    <tbody>
                        {contributions.length > 0 ? (
                            contributions.map((contribution, index) => (
                                <tr key={index}>
                                    <td>{contribution.user}</td>
                                    <td>{contribution.repository}</td>
                                    <td>{contribution.commits}</td>
                                </tr>
                            ))
                        ) : (
                            <tr>
                                <td colSpan="3" className="no-data">No data available</td>
                            </tr>
                        )}
                    </tbody>
                </table>
            </div>

            {/* Pie Chart */}
            {chartData && (
                <div className="chart-container">
                    <h2>User Contributions</h2>
                    <Pie data={chartData} />
                </div>
            )}
        </div>
    );
};

export default Dashboard;
